import { Outlet, useLocation, Navigate } from 'react-router-dom'

import './App.css';
import Title from './components/Title';

function App(props) {
  const location = useLocation()
  return (
    <>
    {location.state ? 
      <div>
        <Title name={location.state} />
        <Outlet />
      </div>
      : 
      <Navigate to="/homePage" />
    }
    </>
  );
}

export default App;
